import React from 'react'
import Home from '../pages/home/Home';
import {
    BrowserRouter as Router,
    Routes,
    Route,
    Link
} from 'react-router-dom'


function AllRoutes() {
    return (
        <Routes>
            <Route>
                <Home />
            </Route>
        </Routes>
    )
}

export default AllRoutes
